import './App.css';
import {Ride} from './components/Ride/ride';
import 'bootstrap/dist/css/bootstrap.min.css';
import {rides} from './data/Ride';
import {user} from './data/User';
import Header from './components/Header/header';
import NearestRides from './views/NearestRides';
import UpcomingRides from './views/UpcomingRides';
import PastRides from './views/PastRides';
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import { Routes, Route } from 'react-router-dom';

function App() {
    return (
            <BrowserRouter basename="/">
                <Header/>
                <Routes>
                    <Route path="/" exact>< NearestRides /></Route>
                    <Route path="/upcoming" exact>< UpcomingRides/></Route>
                    <Route path="/past" exact>< PastRides /></Route>
                </Routes>
            </BrowserRouter>
    );
}

export default App;
